import './Product1.css'

import '../../../Details.js'

function Product1(props) {
  return (
      <div className='product'>
          {
              details.map((item) => {
                const { id, name, description, image } = item;
                if (`/products${id}` == props.location.pathname) {
                      return (
                        <div>
                          <img
                            alt='temp'
                            src={image}
                          />

                        </div>
                      )
                }
              })
          }
      </div>

  )
}

export default Product1
